import styled from "styled-components";

export const Fwrapper = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  width: 100%;
  height: 30px;
  color: ${({ theme }) => theme.colors.primary};
`;
